            <li key={g.name}>
              <Chip label={g.name} sx={{...chip}} />
            </li>
          ))}
    };


    const theme = useTheme();
    const isMobile = useMediaQuery(theme.breakpoints.down("md"));

    return (
        <>
            {isAuthenticated ? (
                <Grid container sx={{ padding: '20px' }}  >
                    <Grid item xs={12} >
                        <Header title="Sign Out" />
                    </Grid>
                    <Box sx={{
                        flexGrow: 1, padding: '40px',
                        '& .MuiOutlinedInput-root': { m: 1 },
                    }}>
                        <Grid container sx={{ justifyContent: 'center', margin: 'auto', height: '600px' }}>
                            {isMobile ? (
                                <Card sx={{ width: '100%', display: 'flex' }}>
                                    <div style={{ justifyContent: 'center', margin: 'auto' }}>
                                        <h2>{context.userName},</h2>
                                        <h2>Welcome to TMDB Client</h2>

                                        <Button
                                            type="submit"
                                            variant="contained"
                                            color="primary"
                                            sx={{
                                                width: '100%'
                                            }}
                                            onClick={() => context.signout()}
                                        >
                                            Sign Out <br />Through mobile
                                        </Button>
                                    </div>
                                </Card>
                            ) : (
                                <Card sx={{ width: '40%', display: 'flex' }}>
                                    <div style={{ justifyContent: 'center', margin: 'auto' }}>
                                        <h2>{context.userName},</h2>
                                        <h2>Welcome to TMDB Client</h2>
                                        <Button
                                            type="submit"
                                            variant="contained"
                                            color="primary"
                                            sx={{
                                                width: '100%'
                                            }}
                                            onClick={() => context.signout()}

                                        >
                                            Sign Out
                                        </Button>

                                    </div>
                                </Card>

                            )}

                        </Grid>
                    </Box>
                </Grid >
            ) : (
                <Grid container sx={{ padding: '20px' }}  >
                    <Grid item xs={12} >
                        <Header title="Log In" />
                    </Grid>
                    <Box sx={{
                        flexGrow: 1, padding: '40px',
                        '& .MuiOutlinedInput-root': { m: 1 },
                    }}>
                        <Grid container sx={{ justifyContent: 'center', margin: 'auto', height: '600px' }}>
                            {isMobile ? (
                                <Card sx={{ width: '100%', display: 'flex' }}>
                                    <div style={{ justifyContent: 'center', margin: 'auto' }}>
                                        <TextField
                                            required
                                            id="outlined-required"
                                            name="username"
                                            label="Username"
                                            InputLabelProps={{ shrink: true }}
                                            sx={{ width: '100%' }}
                                            onChange={(e) => setUserName(e.target.value)}
                                        />
                                        <br />
                                        <TextField
                                            name="password"
                                            id="outlined-multiline-static"
                                            label="Password"
                                            InputLabelProps={{ shrink: true }}
                                            sx={{ width: '100%' }}
                                            onChange={(e) => setPassword(e.target.value)}
                                        />
                                        <br />
                                        <Button
                                            type="submit"
                                            variant="contained"
                                            color="primary"
                                            sx={{
                                                width: '100%'
                                            }}
                                            onClick={login}
                                        >
                                            Log In <br />Through mobile
                                        </Button>
                                        <p>Not Registered?
                                            <Link to="/signup">Sign Up!</Link>
                                        </p>
                                    </div>
                                </Card>
                            ) : (
                                <Card sx={{ width: '40%', display: 'flex' }}>
                                    <div style={{ justifyContent: 'center', margin: 'auto' }}>
                                        <TextField
                                            required
                                            id="username"
                                            name="username"
                                            label="Username"
                                            InputLabelProps={{ shrink: true }}
                                            sx={{ width: '100%' }}
                                            onChange={(e) => setUserName(e.target.value)}
                                        />
                                        <br />
                                        <TextField
                                            name="password"
                                            id="password"
                                            label="Password"
                                            InputLabelProps={{ shrink: true }}
                                            sx={{ width: '100%' }}
                                            onChange={(e) => setPassword(e.target.value)}
                                        />
                                        <br />
                                        <Button
                                            type="submit"
                                            variant="contained"
                                            color="primary"
                                            sx={{
                                                width: '100%'
                                            }}
                                            onClick={login}
                                        >
                                            Log In
                                        </Button>
                                        <p>Not Registered?
                                            <Link to="/signup">Sign Up!</Link>
                                        </p>
                                    </div>
                                </Card>

                            )}

                        </Grid>
                    </Box>
                </Grid >
            )}





        </>
    );
};

export default logInPage;
